import './App.css';
import 'animate.css'
import React, { Component } from 'react';
import { BrowserRouter, Routes, Route, NavLink, Link, Router } from 'react-router-dom';
import Navbar from './Components/Navbar/Navbar';
import Header from './Components/Header/Header';

function App(props) {
  return (
    <BrowserRouter>
      <div className="App">
        <Header />
        <Navbar />
        <Routes>
          <Route path='Page1'
            element={<Component />} />

        </Routes>
      </div>

    </BrowserRouter>
  );
}

export default App;
